// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/HomePage/Home';
import Property from './components/InsuranceForms/Property';
import 'bootstrap/dist/css/bootstrap.min.css';
import SignInPage from './components/InsuranceForms/SignInPage';
import TotalInfo from './components/ListOfPolicies/TotalInfo';
import { UserProvider } from './components/ListOfPolicies/UserContext'; // Import the UserProvider

function App() {
  return (
    <Router>
      <UserProvider>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/property" element={<Property />} />
          <Route path="/signin" element={<SignInPage />} />
          <Route path="/success" element={<TotalInfo />} />
        </Routes>
      </UserProvider>
    </Router>
  );
}

export default App;
